  return (
    <section className="about">
      <h2>About</h2>
      <p>
      Independent web developer with leadership experience and strong technical background supporting a variety of cross-platform software applications. Certified project management professional and recent graduate of The Ohio State Universityâ€™s full stack coding bootcamp. 
      In depth knowledge of Agile principles and software QA testing methods for each phase of the development lifecycle. Self-motivated, team-player with the ability to learn quickly and communicate effectively to build fast rapport with clients and team members of varying seniority, 
      backgrounds and experience.
      </p>
    </section>
  );
}

export default About;
